class List extends Component {
    constructor(props) {
        super(props)
        this.getList = this.getList.bind(this)
        this.state = {
            url: theUrl + '/getAdminList'
        }
    }
    componentDidMount() {
        this.getList(this.props.dispatch, this.state.url)
    }   

    getList = (dispatch, getAdminList) => {

        fetch(getAdminList)
        .then(res => { return res.json() })
        .then(res => {
            dispatch({
                type: 'INIT',
                res
            })
            console.log(res)
        })
    }

    render() {
        return(
            <div>
                <h1>Admin management</h1>
                <h1>this is admin list</h1>
            </div>
        )
    }
}

const mapStateToProps = state => ({
    list: state.list
})

export default connect(
    mapStateToProps
)(List);
